const styles = {
    // Classes
    title: "text-[#00df9a] font-bold p-3 text-3xl",
    subheading: "text-[#00df9a] font-bold text-xl",
    subheading_: "text-blue-500 font-bold text-xl",
    button_start: "p-3 border-white border-r-2 rounded-l-3xl transition-all	hover:scale-105 ease-in-out",
    button_end: "p-3 rounded-r-3xl transition-all hover:scale-105 ease-in-out",
    button: "p-3 border-white border-r-2 transition-all	hover:scale-105 ease-in-out",
    btn_grp: "rounded-3xl border-black border-2",

    // tcp model
    button_tcp: "p-3 m-1 border-t-2 text-center w-48 transition-all hover:scale-105 ease-in-out",

    //back_button
    back: "bg-[#00df9a] text-black rounded-md font-medium my-3 px-5 py-2",

    //ethernet-frame
    ethernet_btn: "p-2 mr-1 border-2 transition-all hover:-translate-y-1 ease-in-out"
}
export default styles
